'use strict';
//@@DocInclude
//@@DocBrief("The class provides basic information about available instruments")
class InstrumentDescriptor {
    offerId;
    symbol;
    sortOrder;
    priceStreamId;
    subscriptionStatus;
    constructor() {
        this.offerId = null;
        this.symbol = null;
        this.priceStreamId = null;
        this.sortOrder = 0;
        this.subscriptionStatus = null;
    }
    getOfferId() {
        return this.offerId;
    }
    getSymbol() {
        return this.symbol;
    }
    getSortOrder() {
        return this.sortOrder;
    }
    getPriceStreamId() {
        return this.priceStreamId;
    }
    getSubscriptionStatus() {
        return this.subscriptionStatus;
    }
}
module.exports = InstrumentDescriptor
